import React from 'react';
import '../index.css';
import { Button } from './Button';
import '../App.css';
import './Main.css';

///need to make mobile responsive

function Main() {
    return (
        <div className='main-container'>
            <div className='left-container'>
                <h1 className='text-8xl'>Hi! I'm Dev Patel</h1>
                <p className='text-2xl'>Computer Science | Business | UNC</p>
                <Button buttonStyle='btn--primary' buttonSize='btn--large' extend="/about">
                    DISCOVER MORE
                </Button>
            </div>
            <div className='right-container'></div>
        </div>
    )
}

export default Main
